class CameraPage extends StatefulWidget {
  final List<CameraDescription>? cameras; // list of cameras
  const CameraPage({this.cameras});

  @override
  _CameraPageState createState() => _CameraPageState();
}

class _CameraPageState extends State<CameraPage> {
  late CameraController controller;
  List<XFile> capturedImages = [];
  XFile? currentImage;

  @override
  void initState() {
    super.initState();
    controller = CameraController(
      widget.cameras![0],
      ResolutionPreset.max,
    );

    controller.initialize().then((_) {
      if (!mounted) {
        return;
      }
      setState(() {});
    });
  }

  @override
  void dispose() {
    controller.dispose();
    super.dispose();
  }

  @override
  Widget build(BuildContext context) {
    if (!controller.value.isInitialized) {
      return const Center(child: CircularProgressIndicator());
    }

    Widget previewWidget;

    if (currentImage == null) {
      previewWidget = Column(
        children: [
          Expanded(
            child: AspectRatio(
              aspectRatio: controller.value.aspectRatio,
              child: CameraPreview(controller),
            ),
          ),
          Row(
            mainAxisAlignment: MainAxisAlignment.spaceEvenly,
            children: [

              ElevatedButton(
                onPressed: () async {
                  XFile? pictureFile = await controller.takePicture();
                  setState(() {
                    currentImage = pictureFile;
                  });
                },
                child: Text('Take Photo'),
              ),
              
              ElevatedButton(
                onPressed: () async {
                  _navigateToImageList(context);
                  //  final List<String> responses = await DBHelper.instance.getResponses();
                },
                child: Text('View Captured Photos'),
              ),
            ],
          ),
        ],
      );
    } else {
      previewWidget = Column(
        children: [
          Expanded(
            child: Image.file(
              File(currentImage!.path),
              fit: BoxFit.contain,
            ),
          ),
          Row(
            mainAxisAlignment: MainAxisAlignment.spaceEvenly,
            children: [
              ElevatedButton(
                onPressed: () {
                  setState(() {
                    currentImage = null;
                  });
                },
                child: Text('Retake Photo'),
              ),


             ElevatedButton(
  onPressed: () async {
    final imageFile = File(currentImage!.path);
    final imageBytes = await imageFile.readAsBytes();
    final base64Image = base64Encode(imageBytes); // Encode image to base64

    print('Base64 Image String: $base64Image'); // Print the base64 image string

    await uploadImageToBackend(base64Image); // Upload base64 image to backend

    setState(() {
      capturedImages.add(currentImage!);
      currentImage = null;
    });
  },
  child: Text('Save Photo'),
),


            ],
          ),
        ],
      );
    }

    return Column(
      children: [
        Expanded(
          child: previewWidget,
        ),
      ],
    );
  }

  void _navigateToImageList(BuildContext context) async {
    bool imageDeleted = await Navigator.push(
      context,
      MaterialPageRoute(
        builder: (context) => ImageListPage(images: capturedImages),
      ),
    );

    if (imageDeleted) {
      setState(() {
        capturedImages.removeWhere((image) => !File(image.path).existsSync());
      });
    }
  }

  Future<String> uploadImageToBackend(String base64Image) async {
    final Uri url = Uri.parse(
        'http://127.0.0.1:8000/create-vehicle/'); // Replace with actual API endpoint
    final Map<String, dynamic> requestBody = {
      'image': base64Image,
      'gps_details': '12.3456,78.9012', // Replace with actual GPS details
    };

    try {
      final response = await http.post(
        url,
        headers: {
          'Content-Type': 'application/json', // Set the content type to JSON
        },
        body: jsonEncode(requestBody), // Encode the request body as JSON
      );

      if (response.statusCode == 200) {
        final responseBody = response.body;
        print('Upload successful. Response: $responseBody');
        return responseBody; // You can handle the response from the backend here
      } else {
        print('Upload failed. Status code: ${response.statusCode}');
      }
    } catch (error) {
      print('Error uploading image: $error');
    }

    return '';
  }
}

class ImageListPage extends StatefulWidget {
  final List<XFile> images;

  ImageListPage({required this.images});

  @override
  _ImageListPageState createState() => _ImageListPageState();
}

class _ImageListPageState extends State<ImageListPage> {
  bool _imageDeleted = false;

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(title: Text('Captured Photos')),
      body: ListView.builder(
        itemCount: widget.images.length,
        itemBuilder: (context, index) {
          return ListTile(
            onTap: () {
              _showFullscreenImageDialog(context, widget.images[index].path);
            },
            leading: Image.file(File(widget.images[index].path),
                width: 50, height: 50),
            title: Text('Image ${index + 1}'),
            trailing: IconButton(
              icon: Icon(Icons.delete, color: Colors.red),
              onPressed: () {
                _deleteImage(index, context);
              },
            ),
          );
        },
      ),
    );
  }

  void _showFullscreenImageDialog(BuildContext context, String imagePath) {
    showDialog(
      context: context,
      builder: (context) {
        return Dialog(
          child: GestureDetector(
            onTap: () {
              Navigator.pop(context);
            },
            child: Container(
              constraints: BoxConstraints.expand(),
              child: Image.file(
                File(imagePath),
                fit: BoxFit.contain,
              ),
            ),
          ),
        );
      },
    );
  }

  void _deleteImage(int index, BuildContext context) async {
    final confirmed = await showDialog(
      context: context,
      builder: (context) {
        return AlertDialog(
          title: Text('Delete Image'),
          content: Text('Are you sure you want to delete this image?'),
          actions: [
            TextButton(
              onPressed: () {
                Navigator.of(context).pop(false); // Cancel the deletion
              },
              child: Text('Cancel'),
            ),
            TextButton(
              onPressed: () {
                Navigator.of(context).pop(true); // Confirm the deletion
              },
              child: Text('Delete'),
            ),
          ],
        );
      },
    );

    if (confirmed != null && confirmed) {
      setState(() {
        widget.images.removeAt(index);
        _imageDeleted = true;
      });
    }
  }
}






